`,paraId:3,tocIndex:2},{value:"NocoBase Application has a built-in ",paraId:4,tocIndex:3},{value:"cli commander",paraId:4,tocIndex:3},{value:", which can be run as CLI tool.",paraId:4,tocIndex:3},{value:`// cmd.js
const { Application } = require('@nocobase/server');
