`,paraId:30,tocIndex:5},{value:"registerAction()",paraId:15},{value:"Register an action with the resourcer. The action is accessible to a specified resource, or all resources if no resource name is specified.",paraId:31,tocIndex:6},{value:"Signature",paraId:32,tocIndex:6},{value:"registerAction(name: string, handler: HandlerType): void",paraId:33,tocIndex:6},{value:"Parameter",paraId:34,tocIndex:6},{value:"Name",paraId:35,tocIndex:6},{value:"Type",paraId:35,tocIndex:6},{value:"Default",paraId:35,tocIndex:6},{value:"Description",paraId:35,tocIndex:6},{value:"name",paraId:35,tocIndex:6},{value:"string",paraId:35,tocIndex:6},{value:"-",paraId:35,tocIndex:6},{value:"Name of the action",paraId:35,tocIndex:6},{value:"handler",paraId:35,tocIndex:6},{value:"HandlerType",paraId:35,tocIndex:6},{value:"-",paraId:35,tocIndex:6},{value:"Handler of the action",paraId:35,tocIndex:6},{value:"A value of ",paraId:36,tocIndex:6},{value:"name",paraId:36,tocIndex:6},{value:" starting with ",paraId:36,tocIndex:6},{value:"<resourceName>:",paraId:36,tocIndex:6},{value:" means that the action is only accessible to ",paraId:36,tocIndex:6},{value:"<resourceName>",paraId:36,tocIndex:6},{value:" rescource, otherwise it is considered as a global action.",paraId:36,tocIndex:6},{value:"Example",paraId:37,tocIndex:6},{value:`// All resources can take the upload action after registration
