`,paraId:45,tocIndex:12},{value:"Pass in ConditionFunc, which can take the ",paraId:46,tocIndex:12},{value:"ctx",paraId:46,tocIndex:12},{value:" parameter; return ",paraId:46,tocIndex:12},{value:"boolean",paraId:46,tocIndex:12},{value:" that indicate whether it is in effect.",paraId:46,tocIndex:12},{value:`// user:list accessible to user with ID of 1
